$(document).ready(function () {

  //*** News page - add older than three months text ***//
  var ThreeMonths = new Date();
  ThreeMonths.setMonth(ThreeMonths.getMonth() - 3);

  if (new Date($('.nvp--blog-created .nvp__date').text()) < ThreeMonths) {
    $(".nvp--blog-created .nvp__time").after("<span class='over-three-months'>This news story is over 3 months old</span>");
  }
 

  //*** Add SVG as a link inside the gi-sitelogo container ***//
  var svgIcon = `
  <div class="flourish-wrapper">
    <a href="https://www.norfolk.gov.uk/flourish" target="_blank" style="margin-right: 10px;" class="flourish-logo" aria-label="Go to the flourish website">
      <svg xmlns="http://www.w3.org/2000/svg" version="1.2" viewBox="0 0 1253 823" width="1253" height="823">
	<title>Flourish logo</title>
	<defs>
		<image width="949" height="637" id="img1" href="data:image/png;base64,"/>
	</defs>
	<style>
	</style>
	<use id="Background" href="#img1" x="148" y="100"/>
</svg>
    </a>
    <p>We want Norfolk to be a county where all children and young people can flourish.</p>
    </div>
  `;

  // Append the image link after the logo
  $('.grid__cell--about.grid__cell--cols1 .grid__cellwrap').append(svgIcon);

  // Log to console for confirmation
  console.log("✅ Linked image added to footer");

});
